INSERT INTO Categorias (nombre_cat, descripcion_cat) VALUES
('Camisetas', 'Prendas superiores de manga corta o larga, generalmente de algodón, utilizadas como ropa casual o deportiva.'),     
('Chaquetas', 'Prendas exteriores que cubren el torso y los brazos, diseñadas para proteger contra el frío o la lluvia.'),
('Gorras_Gorros', 'Accesorios para la cabeza que pueden incluir sombreros con visera o sin ella, gorras de béisbol, entre otros.'),
('Ropa_interior', 'Prendas íntimas que se llevan debajo de la ropa exterior, como sujetadores, calzoncillos, entre otros.'),       
('Pantalones', 'Prendas inferiores que cubren las piernas, como pantalones largos, cortos o faldas.'),
('Sudaderas', 'Prendas superiores de manga larga con capucha, diseñadas para proporcionar comodidad y calidez.'),
('Zapatillas', 'Calzado deportivo diseñado para actividades físicas como correr, caminar o entrenar.');
